FY2016
Develop and utilize both correlative and experimental approaches to evaluate effects of different intensities of spring cattle grazing on sage-grouse habitat selection, insect abundance, and sage-grouse demographic and behavioral traits. Collect data and document the effects of different levels of spring cattle grazing intensity on: 

1) sage-grouse demographic traits; 
2) abundance and biomass of arthropods; 
3) sage-grouse nest concealment and other vegetation/habitat features. 

Analyze the relationship between cattle grazing and sage-grouse demography at multiple spatial scales and evaluate the effects of experimental changes in cattle grazing on sage-grouse reproductive parameters.
